var Handlebars = {};

Handlebars.registerHelper = function(name, fn, inverse) {
  if(inverse) { fn.not = inverse; }
  this.helpers[name] = fn;
};

Handlebars.registerPartial = function(name, str) {
  this.partials[name] = str;
};

Handlebars.registerHelper('helperMissing', function(arg) {
  if(arguments.length === 2) {
    return undefined;
  } else {
    throw new Error("Could not find property '" + arg + "'");
  }
});

var toString = Object.prototype.toString, functionType = "[object Function]";

Handlebars.registerHelper('blockHelperMissing', function(context, options) {
  var inverse = options.inverse || function() {}, fn = options.fn;


  var ret = "";
  var type = toString.call(context);

  if(type === functionType) { context = context.call(this); }

  if(context === true) {
    return fn(this);
  } else if(context === false || context == null) {
    return inverse(this);
  } else if(type === "[object Array]") {
    if(context.length > 0) {
      for(var i=0, j=context.length; i<j; i++) {
        ret = ret + fn(context[i]);
      }
    } else {
      ret = inverse(this);
    }
    return ret;
  } else {
    return fn(context);
  }
});

Handlebars.registerHelper('each', function(context, options) {
  var fn = options.fn, inverse = options.inverse;
  var ret = "";

  if(context && context.length > 0) {

      ret = ret + fn(context[i]);
    }
  } else {
    ret = inverse(this);
  }
  return ret;
});

Handlebars.registerHelper('if', function(context, options) {
  var type = toString.call(context);
  if(type === functionType) { context = context.call(this); }

  if(!context || Handlebars.Utils.isEmpty(context)) {
    return options.inverse(this);
  } else {
    return options.fn(this);
  }
});

Handlebars.registerHelper('unless', function(context, options) {
  var fn = options.fn, inverse = options.inverse;
  options.fn = inverse;
  options.inverse = fn;

  return Handlebars.helpers['if'].call(this, context, options);
});

Handlebars.registerHelper('with', function(context, options) {
  return options.fn(context);
});

Handlebars.Exception = function(message) {
  var tmp = Error.prototype.constructor.apply(this, arguments);

  for (var p in tmp) {

  }

  this.message = tmp.message;

};
Handlebars.SafeString.prototype.toString = function() {
  return this.string.toString();
};

(function() {
  var escape = {
    "<": "&lt;",
    ">": "&gt;",
    '"': "&quot;",
    "'": "&#x27;",
    "`": "&#x60;"
  };

  var badChars = /&(?!\w+;)|[<>"'`]/g;
  var possible = /[&<>"'`]/;

  var escapeChar = function(chr) {
    return escape[chr] || "&amp;";
  };

  Handlebars.Utils = {
    escapeExpression: function(string) {
      // don't escape SafeStrings, since they're already safe
      if (string instanceof Handlebars.SafeString) {
        return string.toString();
      } else if (string == null || string === false) {
        return "";
      }

      if(!possible.test(string)) { return string; }
      return string.replace(badChars, escapeChar);
    },

    isEmpty: function(value) {
      if (typeof value === "undefined") {
        return true;
      } else if (value === null) {
        return true;
      } else if (value === false) {
        return true;
      } else if(Object.prototype.toString.call(value) === "[object Array]" && value.length === 0) {
        return true;
      } else {
        return false;
      }
    }
  };
})();;
// lib/handlebars/runtime.js
Handlebars.VM = {
  template: function(templateSpec) {
    // Just add water
    var container = {
      escapeExpression: Handlebars.Utils.escapeExpression,
      invokePartial: Handlebars.VM.invokePartial,
      programs: [],
      program: function(i, fn, data) {
        var programWrapper = this.programs[i];
        if(data) {
          return Handlebars.VM.program(fn, data);
        } else if(programWrapper) {
          return programWrapper;
        } else {
          programWrapper = this.programs[i] = Handlebars.VM.program(fn);
          return programWrapper;
        }
      },
      programWithDepth: Handlebars.VM.programWithDepth,
      noop: Handlebars.VM.noop
    };

    return function(context, options) {
      options = options || {};
      return templateSpec.call(container, Handlebars, context, options.helpers, options.partials, options.data);
    };
  },

  programWithDepth: function(fn, data, $depth) {
    var args = Array.prototype.slice.call(arguments, 2);

    return function(context, options) {
      options = options || {};

      return fn.apply(this, [context, options.data || data].concat(args));
    };
  },
  program: function(fn, data) {
    return function(context, options) {
      options = options || {};

      return fn(context, options.data || data);
    };
  },
  noop: function() { return ""; },
  invokePartial: function(partial, name, context, helpers, partials, data) {
    options = { helpers: helpers, partials: partials, data: data };

    if(partial === undefined) {
      throw new Handlebars.Exception("The partial " + name + " could not be found");

    } else {

      return partials[name](context, options);

Handlebars.registerHelper('projectsDropdownSelection',
    function (selectedId, projects, options) {
        if (projects) {
            var proj;
            $(projects).each(function () {
                if (this.id == selectedId) {
                    proj = this;

                }
            });
            if (proj)
                return options.fn(proj);

Handlebars.registerHelper('isEqual',
    function (val1, val2, options) {
        if (val1 == val2)
            return options.fn(this);
        return options.inverse(this);
    });

    function (text) {
        var converter = new Attacklab.showdown.converter();
        return new Handlebars.SafeString(converter.makeHtml(text));
    });

    function (request, source) {
        return new Handlebars.SafeString(CodeRender.render(request, source, { includeMethodMarkers: false }));
    });

    function (request, source, options) {
        return new Handlebars.SafeString(CodeRender.render(request, source, { includeMethodMarkers: true }));
    });
Handlebars.registerHelper('length',
    function (array) {
        if (array) {
            return array.length.toString();
        }
        return '0';
    });
Handlebars.registerHelper('debug',
    function (context) {
        console.log('--- CONTEXT ---');

        console.log('--- STACK ---');
        console.log(this.__stack__);
        console.log('-------------');
    });
Handlebars.registerHelper('isExe',
    function (type, options) {
        if (type == 'Exe')
            return options.fn(this);
        else
            return options.inverse(this);
    });
Handlebars.registerHelper('isNotExe',
    function (type, options) {
        if (type != 'Exe')
            return options.fn();
        else
            return options.inverse();
    });
Handlebars.registerHelper('selectDropdownId',
    function (Id, ddArray, options) {
        if (Id == 'current' && ddArray.length > 0) {
            return options.fn(ddArray[0]);
        }
        for (var item in ddArray) {
            if (ddArray[item].id == Id)
                return options.fn(ddArray[item]);
        }
        return options.inverse();
    });
Handlebars.registerHelper('getSelectedExecution',
    function (projectId, execId, executions, options) {
        if (execId == 'current' && executions.length > 0) {
            return options.fn(executions[0]);
        }

        for (var item in executions) {
            if (executions[item].id == execId)
                return options.fn(executions[item]);
        }

        var execFromAPI = null;
        requestHelper.syncGetExecutionRef(projectId, execId, function (data) {
            execFromAPI = data.execution;
        }, function () { });  // silent error handler

        if (execFromAPI)
            return options.fn(execFromAPI);
        else
            return options.inverse(this);
    });

    function (codeNode) {
        switch (codeNode.codeNodeType) {
            case 'Module': return ('module_icon');

            case 'Method': return ('method_icon');
            case 'Property': return ('property_icon');
        }

                    return new Handlebars.SafeString('\\');
            }
        }

Handlebars.registerHelper('nodeOrDocType',

Handlebars.registerHelper('countReceiving',
    function (projects) {
        if (!projects || projects.length == 0)
            return 0;
        else {
            var receivingCt = 0;
            $(projects).each(function () {
                if (this.enabled == true && this.status == ncover.projectStatus.receiving)
                    receivingCt++;
            });

Handlebars.registerHelper('countMonitoring',
    function (projects) {
        if (!projects || projects.length == 0)
            return 0;
        else {
            var monitorCt = 0;
            $(projects).each(function () {
                if (this.enabled == true && this.config.enabledOnCC != false && this.status != ncover.projectStatus.collecting)
                    monitorCt++;
            });
            return monitorCt;
        }
    });

Handlebars.registerHelper('countCollecting',
    function (projects) {
        if (!projects || projects.length == 0)
            return 0;
        else {
            var ct = 0;
            $(projects).each(function () {

                    ct++;
            });
            return ct;
        }
    });
Handlebars.registerHelper('elapsedHours',
    function (timeStart, timeEnd) {
        if (!timeStart || !timeEnd)
            return 0;
        var msPerHour = 1000.0 * 60.0 * 60.0;
        var end = new Date();
        end.setTime(timeEnd)
        var start = new Date();
        start.setTime(timeStart);
        var diff = end - start;
        diff = Math.round(diff * 100 / msPerHour) / 100; // round to 2 decimals
        return diff < 0.01 ? 0.01 : diff; // don't return anything less than 0.01
    });
Handlebars.registerHelper('utcToLocal',
    function (ms) {
        if (!ms)
            return 'No date provided';
        var newDate = new Date(ms);
        if (newDate == 'Invalid Date') {
            return ms;
        } else {
            return newDate.toDateString() + ' ' + newDate.toLocaleTimeString();
        }
    });
Handlebars.registerHelper('artifactDateString',
    function (ms) {
        if (!ms)
            return 'No date provided';
        var newDate = new Date();
        newDate.setTime(ms);
        return newDate.toDateString() + ' ' + newDate.toLocaleTimeString();
    });
Handlebars.registerHelper('shortDateString',
    function (date) {
        if (!date)
            return 'No data provided';
        var newDate = ncover.getLocalDateTimeShort(date);
        return newDate;
    });
Handlebars.registerHelper('longDateString',
    function (date) {
        if (!date)
            return 'No data provided';
        return ncover.getLocalDateTimeLong(date);
    });
Handlebars.registerHelper('projectEnableClass',
    function (enabled) {
        if (enabled)
            return 'enabled';

            return 'disabled';
    });

        return options.inverse(this);
    });

    function (val1, val2) {
        return val1 / val2;
    });
Handlebars.registerHelper('divide_int',
    function (val1, val2) {
        return Math.floor(val1 / val2);
    });
Handlebars.registerHelper('multiply',
    function (val1, val2) {
        return val1 * val2;
    });
Handlebars.registerHelper('multiply_int',
    function (val1, val2) {
        return Math.floor(val1 * val2);
    });
Handlebars.registerHelper('floor',
    function (val1) {
        return Math.floor(val1);
    });
Handlebars.registerHelper('subtract',
    function (val1, val2) {
        return val1 - val2;
    });

Handlebars.registerHelper('hasValue',
    function (val, options) {
        if (val === undefined || val === null)
            return options.inverse(this);
        return options.fn(this);
    });

Handlebars.registerHelper('isDefined',
    function (val, options) {
        if (val === undefined)
            return options.inverse(this);
        return options.fn(this);
    });
Handlebars.registerHelper('isGreaterThanZero',
    function (val, options) {
        if (val > 0)
            return options.fn(this);
        return options.inverse(this);

Handlebars.registerHelper('isGreaterThan',
    function (val1, val2, options) {

Handlebars.registerHelper('showContentsPane',

Handlebars.registerHelper('isMatch',
    function (val1, val2, options) {
        return val1 == val2 ? options.fn(this) : options.inverse(this);

Handlebars.registerHelper('isNotNa',
    function (val1, options) {
        return val1 != 'n/a' ? options.fn(this) : options.inverse(this);
    });
Handlebars.registerHelper('getScrollParam',
    function (scrollId) {
        if (scrollId) {
            var curLoc = ncover.getLocation();
            var newLoc = requestHelper.setQueryParam(curLoc, 'scrollId', scrollId);

Handlebars.registerHelper('currentParams',
    function () {

Handlebars.registerHelper('isMergedExecution',

Handlebars.registerHelper('getBcExecutionIcon',

Handlebars.registerHelper('resultIcon',

Handlebars.registerHelper('headerIconClass',
    function (codeNodeType) {
        switch (codeNodeType) {
            case ncover.codeNodeTypes.Module:
                return 'statIcon sprite module_icon';
            case ncover.codeNodeTypes.Namespace:
                return 'statIcon sprite namespace_icon';
            case ncover.codeNodeTypes.Class:
                return 'statIcon sprite class_icon';
            case ncover.codeNodeTypes.Property:
                return 'statIcon sprite property_icon';
            case ncover.codeNodeTypes.Method:
                return 'statIcon sprite method_icon';
            case ncover.codeNodeTypes.Document:
                return 'statIcon sprite document_icon light';
            case ncover.codeNodeTypes.Folder:
                return 'statIcon sprite file_icon light';

Handlebars.registerHelper('captureOrExecutionNav',
    function (projectId, executionId, captureId, codeNode) {
        // folders are stored within static captures so execution is used for navigation
        if (codeNode != null && codeNode.codeNodeType == 'Folder') {
            if (executionId && executionId != 'current') {
                return 'executions/' + executionId + '/';
            } else if (captureId && captureId != 'current') {
                requestHelper.syncGetExecutionRefByCapture(projectId, captureId, function (ref) {
                    return 'executions/' + ref.execution.id + '/';

            return 'captures/' + captureId + '/';

<script type='text/javascript'>// create a global object to scope all data and functions
if (typeof ncover === 'undefined')
    ncover = {};

// initialze the page to show execution summary
ncover.removeRowElements = function (classType) {
    var tbody = document.getElementById('coverage-detail-body');
    var doRemove = function (elements) {
        for (var i = 0; i < elements.length; i++)
            tbody.removeChild(elements[i]);
    };

    var repeatRemove = function (className) {
        var els = document.getElementsByClassName(className);
        while (els.length) {
            doRemove(els);
            els = document.getElementsByClassName(className);
        }
    };

    repeatRemove(classType + ' stats');
    repeatRemove(classType + ' stats blur');
    repeatRemove(classType + ' stats expanded');
};


ncover.showChildClasses = function (el) {
    if (!el || !el.nextElementSibling)
        return;

    var displayElement = el.nextElementSibling;
    // until we find another module
    while (displayElement && !displayElement.classList.contains('module')) {
        // skip methods
        if (displayElement.classList.contains('class')) {
            displayElement.classList.remove('hidden');
            displayElement.classList.remove('blur');
            ncover.displayChildThinBars(displayElement);
        }
        displayElement = displayElement.nextElementSibling;
    }
}

ncover.hideStatCellThinBars = function () {
    var cells = document.getElementsByClassName('stat_cell');
    for (var i = 0; i < cells.length; i++) {
        for (var j = 0; j < cells[i].children.length; j++) {
            var child = cells[i].children[j];
            if (child.classList && child.classList.contains('thinbar'))
                child.classList.add('hidden')
        }
    }
};

ncover.displayChildThinBars = function (target) {
    var doDisplay = function (el) {
        if (!el.children) return;
        for (var i = 0; i < el.children.length; i++) {
            var child = el.children[i];
            if (child.tagName == "DIV" && child.classList && child.classList.contains('stat_cell'))
                ncover.displayStatCellThinBars(child);
            else if (child.children)
                doDisplay(child);
        }
    };

    if (target.length) {
        // process all elements in array
        for (var i = 0; i < target.length; i++)
            doDisplay(target[i]);
    } else {
        doDisplay(target);
    }
}

ncover.displayStatCellThinBars = function (el) {
    if (!el.children) return;

    for (var i = 0; i < el.children.length; i++) {
        var child = el.children[i];
        if (child.classList && child.classList.contains('thinbar'))
            child.classList.remove('hidden');
    }
};

ncover.showChildMethods = function (el) {
    if (!el || !el.nextElementSibling)
        return;
    var displayElement = el.nextElementSibling;
    // until we find another class
    while (displayElement && displayElement.classList && displayElement.classList.contains('method')) {
        displayElement.classList.remove('hidden');
        displayElement.classList.remove('blur');
        ncover.displayChildThinBars(displayElement);
        displayElement = displayElement.nextElementSibling;
    }
}


ncover.toggleModuleExpand = function (el) {
    ncover.removeRowElements('class');
    ncover.removeRowElements('method');
    ncover.hideStatCellThinBars();

    var expanding = !el.classList.contains('expanded');
    var setClasses = function (modules) {
        for (var i = 0; i < modules.length; i++) {
            modules[i].classList.remove('expanded');
            if (expanding)
                modules[i].classList.add('blur');
            else
                modules[i].classList.remove('blur');
        }
    };
    setClasses(document.getElementsByClassName('module stats'));


    if (expanding) {
        var moduleid = el.dataset.moduleid;
        var classes = ncover.modules[moduleid].classes;
        var targetEl = el;
        for (var id in classes) {
            var cls = classes[id];
            cls.moduleid = moduleid;
            cls.key = id;
            var rowHTML = Handlebars.templates['class_detail'](cls);
            targetEl.insertAdjacentHTML('afterend', rowHTML);
            targetEl = targetEl.nextElementSibling;
        }

        el.classList.add('expanded');
        el.classList.remove('blur');
        ncover.displayChildThinBars(el);
        ncover.showChildClasses(el);
    } else {
        ncover.displayChildThinBars(document.getElementsByClassName('module stats'));
    }
};


ncover.toggleClassExpand = function (el) {
    ncover.removeRowElements('method');
    ncover.hideStatCellThinBars();
    var expanding = !el.classList.contains('expanded');
    var setClasses = function (classes) {
        for (var i = 0; i < classes.length; i++) {
            classes[i].classList.remove('expanded');
            if (expanding)
                classes[i].classList.add('blur');
            else
                classes[i].classList.remove('blur');
        }
    };
    setClasses(document.getElementsByClassName('class stats'));
    setClasses(document.getElementsByClassName('class stats expanded'));

    if (expanding) {
        var moduleid = el.dataset.moduleid;
        var classid = el.dataset.classid;
        var methods = ncover.modules[moduleid].classes[classid].methods;
        var targetEl = el;
        for (var id in methods) {
            var mth = methods[id];
            var rowHTML = Handlebars.templates['method_detail_report'](mth);
            targetEl.insertAdjacentHTML('afterend', rowHTML);
            targetEl = targetEl.nextElementSibling;
        }

        el.classList.add('expanded');
        el.classList.remove('blur');
        ncover.displayChildThinBars(el);
        ncover.showChildMethods(el);
    } else {
        ncover.displayChildThinBars(document.getElementsByClassName('class stats'));
    }
    ncover.displayChildThinBars(document.getElementsByClassName('module stats expanded'));
};




</script>
